    [],nt"revision_timestamp": "2013-03-15T09:35:14.778653",nt"name": "unpublished-digital-geologic-map-of-jewel-cave-national-monument-and-vicinity-south-dakota-2003",nt"isopen":
    false,nt"url": null,nt"notes": "The Unpublished Digital Geologic Map of
    Jewel Cave National Monument and Vicinity, South Dakota is composed of GIS data
    layers complete with ArcMap 9.3 layer (.LYR) files, two ancillary GIS tables, a
    Map PDF document with ancillary map text, figures and tables, a FGDC metadata record
    and a 9.3 ArcMap (.MXD) Document that displays the digital map in 9.3 ArcGIS. These
    data formats also fully represent all of the features present on a GRI digital map,
    as well as containing related ancillary information GIS data tables. The data is
    also available as a 2.2 KMZ/KML file for use in Google Earth. Google Earth software
    is available for free at: http://www.google.com/earth/index.html. Users are encouraged
    to only use the Google Earth data for basic visualization, and to use the GIS data
    for any type of data analysis or investigation. The data were completed as a component
    of the Geologic Resources Inventory (GRI) program, a National Park Service (NPS)
    Inventory and Monitoring (I&M) Division funded program that is administered by the
    NPS Geologic Resources Division (GRD). Source geologic maps and data used to complete
    this GRI digital dataset were provided by the following: U.S. Geological Survey.
    Detailed information concerning the sources used and their contribution the GRI
    product are listed in the Source Citation section(s) of this metadata record (jeca_metadata.xml;
    available at http://nrdata.nps.gov/geology/gri_data/gis/jeca/jeca_metadata.xml).
    Users of this data are cautioned about the locational accuracy of features within
    this dataset. Based on the source map scale of 1:100,000 and United States National
    Map Accuracy Standards features are within (horizontally) 52 meters or 167 feet
    of their actual location as presented by this dataset. Users of this data should
    thus not assume the location of features is exactly where they are portrayed in
    Google Earth, ArcGIS or other software used to display this dataset. All GIS and
    ancillary tables were produced as per the NPS GRI Geology-GIS Geodatabase Data Model
    v. 2.1. (available at: http://science.nature.nps.gov/im/inventory/geology/GeologyGISDataModel.cfm).
    The GIS data is available as a 9.3 personal geodatabase (jeca_geology.mdb), and
    as shapefile (.SHP) and DBASEIV (.DBF) table files. The GIS data projection is NAD83,
    UTM Zone 13N, however, for the KML/KMZ format the data is projected upon export
    to WGS84 Geographic, the native coordinate system used by Google Earth. The data
